INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(1, 'Placa de Vídeo Galax GeForce GTX 1660', 1500, , 'GeForce GTX 1660 (1-CLICK OC) é meticulosamente trabalhada para oferecer dissipação de calor superior, usando materiais premium junto com Dual FAN de 90 mm. Para um melhor desempenho, o recurso 1 Click OC incluído executa o processo com apenas 1 botão que impulsionará as configurações de overclock mais altas e estáveis para a placa gráfica.', 'Marca: Galax\r\n<br/>Modelo: 60SRH7DSY91C\r\n<br/>NVIDIA GeForce GTX 1660\r\n<br/>PCI Express 3.0', 152);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(3, 'Placa de Vídeo MSI AMD Radeon RX 570', 600, , 'Placa de Vídeo MSI AMD Radeon RX 570 Armor 4G OC, GDDR5.', 'Marca: MSI\r\n<br/>Modelo: RX 570 Armor 4G OC\r\n<br/>Gráfico Radeon RX 570                              <br/>PCI Express x16', 305);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(4, 'Placa de video ASUS GTX1060 DUAL', 1200, , 'O Concorrente de peso do Segmento intermediário Nvidia, Supra sumo da tecnologia! Geforce GTX 1060 é garantia de sucesso, trazendo desempenho compatível com as tops da geração passada, fazem qualquer jogo rodar tranquilamente em Full HD para eliminar as preocupações de saber se um jogo roda ou não roda, quando você esta acompanhado de GTX 1060 você pode jogar de tudo! Potência, qualidade e confiabilidade. Chega de regular os jogos para adequar a performance, com Geforce GTX, o jogo se adapta.', '- Marca: ASUS\r\n<br/> Modelo: DUAL-GTX1060-O6G', 424);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(5, 'Placa de Vídeo Gigabyte GeForce RTX 2070', 2800, , 'Gigabyte Geforce RTX 2070 Super Gaming conta com uma iluminação surpreendente, com 16.7M opções de cores personalizáveis e inigualáveis de iluminação, transforme o seu PC em uma máquina poderosa. O sistema de resfriamento WINDFORCE 3X possui 3x ventiladores de lâmina exclusivos de 82mm, ventilador giratório alternado, 6 tubos de calor de cobre composto, toque direto de tubo de calor.', 'Marca: Gigabyte\r\n<br/>Modelo: GV-N207SGAMING <br/>OC-8GC\r\n<br/>GeForce RTX 2070 SUPER\r\n<br/>PCI-E 3.0 x 16', 101);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(11, 'Placa de Vídeo Galax GeForce GTX 1060 OC', 1100, , 'A placa de vídeo NVIDIA GeForce GTX 1060 6GB equipada com memória GDDR5X oferece excelente custo benefício, sendo recomendada para rodar jogos como CS:GO a 177 FPS com qualidade no Ultra, Overwatch a 170 FPS no Ultra, Dota 2 a 132 FPS no Ultra, Tom Clancy’s Rainbow Six Siege a 124 FPS no Ultra, Battlefield 1 a 79 FPS no Ultra, Resident Evil 7 a 83 FPS no Ultra e GTA V a 72 FPS no Alto, todos os games em full HD 1080p.', ' Chipset: GTX 1060 OC\r\n- Velocidade do núcleo: 1020 MHz\r\n- Memória: 6GB\r\n- Tipo de memória: GDDR5X\r\n- Frequência de memória: 8008MHz\r\n- Interface de memória: 192 bit\r\n- Interface: Pci Express 3.0 1', 46);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(13, 'Placa de Video MSI GeForce RTX 2060 Super GAMING X Dual', 2745, , 'A GeForce® RTX 2060 SUPER™ é equipada com tecnologia da premiada arquitetura NVIDIA Turing™ e tem uma GPU super-rápida com mais cores e clocks para liberar sua produtividade criativa e domínio dos games. Chegou a hora de se equipar com superpoderes.', 'Marca: \r\nMSI\r\n\r\nModelo: \r\nRTX 2060 Super - 912-V375-214 \r\n\r\nInterface: \r\nPci Express 3.0 16X \r\n\r\nProcessador de Vídeo (GPU):\r\nTU106\r\n\r\nFrequencia do Processador de Vídeo (GPU): \r\n1695 MHz\r\n\r\nMemória: \r\n8GB GDDR6', 10);
INSERT INTO `produtos` (`id`, `nome`, `valor`, `IMG`, `descrição`, `caracteristicas`, `click`) VALUES
(14, 'Placa de Vídeo Colorful iGame Geforce RTX 2080 Ti Advanced OC', 7059, , 'A melhor e mais atual placa de vídeo da NVIDIA revoluciona o realismo e o desempenho dos games. Sua poderosa arquitetura de GPU NVIDIA Turing™, além de tecnologias inovadoras e dos 11 GB de memória GDDR6 ultrarrápida de próxima geração fazem dela a melhor placa de vídeo para games do mundo.', 'Marca: \r\nColorful\r\n\r\nModelo: \r\niGame GeForce RTX 2080 Ti Advanced OC\r\n\r\nInterface: \r\nPci Express 3.0 16X \r\n\r\nProcessador de Vídeo (GPU):\r\nTU102\r\n\r\nFrequencia do Processador de Vídeo (GPU): \r\nBase：1350Mhz；Boost:1635Mhz', 8);

